import React from "react";
import {Drawer} from "@material-ui/core";


const ListDropdown = (props) => {
    return(
        <Drawer style={{ width: "10px", height: "4px"  }} anchor="left"  open={props.open}
                onClose={() => props.onClose(false)}>
           <div>

           </div>
        </Drawer>

    );

};

export default ListDropdown;
